At long last, the team book you've been waiting for! The return of the Defenders! (No trademark infringement here!) And look who's on the team: The mutant Colossus! The sensational She-Hulk! The unpredictable Blazing Skull! An all-new lineup led by the enigmatic Nighthawk! Injected into the heart of the modern Marvel Universe, the Defenders have been reformed to serve a specific political purpose - but is there a greater destiny in store for this crew? It's hi-octane superheroics mainlined right into your fanboy brain!

